import { BrowserRouter, Routes, Route, useParams } from "react-router-dom";
import Login from "./pages/login/login";
import Home from "./pages/home/home";
import { useState } from "react";
function App() {
  const [idAdmin, setAdmin] = useState(null);
  console.log(idAdmin);
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route exact path="/" element={<Login setAdmin={setAdmin} />} />
          <Route path="/home" element={<Home setAdmin={setAdmin} />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
